choices.text:
TypeUtils.accept(parser, JSONToken.LBRACKET);
if (lexer.token() != JSONToken.RBRACKET) {
    int index = 0;
    do {
        Object val = parser.parseObject(componentType, index);
        array.add(val);
        ++index;
    } while (lexer.token() == JSONToken.COMMA);
}
TypeUtils.accept(parser, JSONToken.RBRACKET);

if (lexer.token() == JSONToken.RBRACKET) {
    lexer.nextToken(JSONToken.COMMA);
} else {
    parser.parseArray(componentType, array, fieldName);
}

